import React from 'react';
import Row from './Row.js'

class Map extends React.Component {
  constructor(props) {
    super(props);
    this.map = props.map;
    this.createRows = this.createRows.bind(this);
  }

  createRows() {
    let rows = []
    for (let i = 0; i < 10; i++) {
      rows.push(<Row key={1000 + i} handleClick={this.props.handleClick}
        handleDrop={this.props.handleDrop} map={this.props.map} row={i} />);
    }
    let map = []
    map.push(<div className="grid-row">{rows}</div>)
    return map;
  }

  render() {
    return (
      <div>
        {this.createRows()}
      </div>
    )
  }
}

export default Map
